const Layout = ({children}) => {
    const nav = () =>  (
        <>
        <ul className="nav">
            <li className="nav-item"><a href="">{children}Home</a></li>
        </ul>
        <ul className="nav">
            <li className="nav-item"><a href="">{children}Login</a></li>
        </ul>
        <ul className="nav">
            <li className="nav-item"><a href="">{children}Register</a></li>
        </ul>
        </>
    );
    return (
        <>
        {nav()}
    </>);
};

export default Layout;
